function ImagePopup() {
  return (
    <div className="popup image-popup popup-hidden">
      <div className="image-popup__container">
        <button
          className="image-popup__close-button popup__close-button"
          type="button"
        ></button>
        <img className="image-popup__image" />
        <h4 className="image-popup__location"></h4>
      </div>
    </div>
  );
}
export default ImagePopup;
